kubectl 相关命令实现该接口（属性与方法）时，重点关注的是Run() 方法，Run() 方法是更具体的任务执行的方法。例如，在NewKubectlCommand() 实现了kubectl 的顶层命令kubectl xxx ，在该顶层方法中抽象Run() 用runHelp()  进行实例化;在其子命令kubectl create -f xxx的方法中，抽象Run() 在NewCmdCreate(）方法中实现。
那么这些Run( ) 方法是何时被调用的呢？回到cmd.Execute()，看一下Execute( ) 方法的行为。Execute() 方法的大致执行流程是 Execute() -> ExecuteC() ->execute()，走到execute 方法，看其实现：
github.com/spf13/cobra/command.go 
 func (c *Command) execute(a []string) (err error) {
    ...
    c.initHelpFlag()
    ...

    c.preRun()
    ... 
    if c.RunE != nil {
        if err := c.RunE(c, argWoFlags); err != nil {
            return err
        }
    } else {
        c.Run(c, argWoFlags)
    }

    ...
    return nil
