pkg/kubectl/cmd/create.go
func RunCreate(f cmdutil.Factory, cmd *cobra.Command, out, errOut io.Writer, options *CreateOptions) error {
    if len(options.Raw) > 0 {...}
    ...

    /*cmdutil.GetFlagBool(cmd, "validate") 默认为true
      schema 为Schema 列表，包含了对资源文件的验证方法列表*/
    schema, err := f.Validator(cmdutil.GetFlagBool(cmd, "validate")) 

    /*cmdNamepace 接收 命令行中指定的namepace 值,enforceNamespace 一般为true */ 
    cmdNamespace, enforceNamespace, err := f.DefaultNamespace() 

    r := f.NewBuilder().
        Unstructured().
        Schema(schema).
        ContinueOnError().
        NamespaceParam(cmdNamespace).DefaultNamespace().
        FilenameParam(enforceNamespace, &options.FilenameOptions).
        LabelSelectorParam(options.Selector).
        Flatten().
        Do()
    ...
    err = r.Visit(func(info *resource.Info, err error) error {...}
}
主要看f.NewBuilder() 和r.Visit()。f.NewBuilder() 返回一个Builder 结构体 [pkg/kubectl/resource/builder.go] 实例。f.NewBuilder() 后边调用的方法很多，Unstructured、Schema、ContinueOnError、NamespaceParam、FilenameParam、LabelSelectorParam和Flatten都是Builder结构的方法，并返回Builder 结构的指针。执行这些方法类似一个流水线工作，每个方法执行一些对Builder结构体实例的修改，并且将这个实例返回给中线上的下一个方法来执行其他修改，最后实例调用Do() 方法，这些方法的实现都在pkg/kubectl/resource/result.go  文件中。Do() 方法返回值 r 的是一个Result 结构体实例 [pkg/kubectl/resource/result.go]。
 接着对象 r 调用Visit()方法 。传入Visit()的参数一个VisitorFunc 类型的匿名函数 ，记匿名函数名称为 fn_ins0, 该函数真正执行的地方将在 Visit 方法执行 一节 分析。先看到Visit()的实现：
pkg/kubectl/resource/result.go
func (r *Result) Visit(fn VisitorFunc) error {
    if r.err != nil {
        return r.err
    }
    err := r.visitor.Visit(fn)
    return utilerrors.FilterOut(err, r.ignoreErrors...)
}
对象r的属性visitor 为 Visitor 接口类型，Visitor 该接口的声明为：
pkg/kubectl/resource/visitor.go
type Visitor interface {
    Visit(VisitorFunc) error
}
代码中使用了多态的方式实现了该接口（主要集中在pkg/kubectl/resource/visitor.go 和 pkg/kubectl/resource/selector.go文件中）。此处具体调用的是哪个Visit() 方法，需要回到Do() 方法中看Result 实例的生成及属性visitor 被赋予的具体类型。
